class SpiderMain(object):
    def __init__(self):
        # 入口页url
        self.index_url = 'http://c.old.wanfangdata.com.cn/PatentIndex.aspx'

    def handle(self, redis_client, country_name, country_url):
        mysql_client = mysqlpool_utils.createMysqlPool()
        page = 1
        while 1:
            # 获取当前页响应
            classify_url = country_url.format(page)
            page_resp = download_middleware.getPatentClassifyRest(logging=LOGGING, redis_client=redis_client,
                                                                  url=classify_url)
            # 获取当前页的专利url列表
            patent_url_list = services.getPatentUrlList(logging=LOGGING, resp=page_resp)
            print(patent_url_list)
            # 专利url存储mysql
            if patent_url_list:
                for patent_url in patent_url_list:
                    try:
                        dao.savePatentUrlInMysql(logging=LOGGING, connection=mysql_client, url=patent_url, country_name=country_name)
                        LOGGING.info('{}已保存'.format(patent_url))
                    except IntegrityError:
                        LOGGING.error('当前专利url已存在')

            # 获取总页数
            page_sum = services.getPageSum(logging=LOGGING, resp=page_resp)
            # 判断是否已达到最后一页
            if page + 1 > int(page_sum):
                break
            else:
                # LOGGING.info('第{}页数据已抓取完毕'.format(page))
                page += 1

                continue
            # break


